import { Input, Button, InputGroup } from "reactstrap";
import FiltroPesquisa from "../FiltroPesquisa/Index";
import "./Input.css"

const InputDefault = () => {

    const [isActive, setActive] = useState(false);

    const clickActive = (event) =>{
        // event.target.classList.toggle("active")
        console.log("botao clicado")
     
    }

    return (<div className="grupo-pequisa">

        <div className="aba-busca">
            <ul className="aba-pequisa">
                <FiltroPesquisa  tab="#1" label="Buscar por produto" onClick={clickActive} />
                <FiltroPesquisa tab="#2" label="Palavra-chave" />
                <FiltroPesquisa tab="#3" label="Marca/modelo do veículo" />
            </ul>
        </div>



        <div className="container-input">
            <InputGroup>
                <Input placeholder="Encontre um produto digitado um código de peças Gauss ou um código referência" />
                <Button>
                    <img src="./imagens/lupa.png" />
                </Button>
            </InputGroup>
        </div>
    </div>);
}

export default InputDefault;
